import React from 'react';
import {
    ShowsContainer, ShowsBg, ShowsContent, ShowsH1, ShowsAnnounceBox, ShowsP
} from './ShowsElements'

const show_data = [
    { date: '08/16/22', city: 'Philadelphia', 'venue': 'The Fillmore'},
    { date: '08/17/22', city: 'Baltimore', 'venue': 'The Baltimorean'},
    { date: '08/18/22', city: 'New York', 'venue': 'Madison Square Garden'},
]


const Shows = () => {
    return (
        <>
            <ShowsContainer id="shows"> 
                <ShowsBg />

                <ShowsContent>

                    <ShowsAnnounceBox>
                        <ShowsH1>upcoming shows</ShowsH1>
                        <ShowsTable>
                            <tr>
                                <th>Name</th>
                                <th>Age</th>
                                <th>Gender</th>
                            </tr>
                            {show_data.map((val, key) => {
                            return (
                                <tr key={key}>
                                <td>{val.date}</td>
                                <td>{val.city}</td>
                                <td>{val.venue}</td>
                            </tr>
                        )
                        })}
                        </ShowsTable>
                    </ShowsAnnounceBox>




                </ShowsContent>

            </ShowsContainer>

        </>
    )
};

export default Shows;
